import { useState, useEffect } from 'react';

function Players() {

    const [data, setData] = useState([]);

    useEffect(() => {
        fetch('http://127.0.0.1:8000/api/app/')
        .then(res => res.json())
        .then(data => {
            setData(data);
        })
        .catch(err => {
            console.log(err);
        });
    }, []);

    return (
        <div id="players-main">
            <h1>Players</h1>
            {data.map((player) => {
                const { name, price} = player;
                return (
                    <div>
                        <p>{name}</p>
                        <p>{price}</p>
                    </div>
                )
            })}
        </div>
    )
}



export default Players;
